import Button from "./Button";
import styles from "./App.module.css";

function App() {
  const [counter, setValue] = useState(0);
  const onClick = () => setValue((prev) => prev + 1);

  return(
    <div>
      <h1 className={styles.title}>Welcome Back !!</h1>
      <Button text={"hello"} />
      <Button text={"click me"} />
    </div>
  );
}

export default App;
